       <p 
        class="token-introduction-text" 
      > The native cryptographically-secure fungible protocol token of Cetus. 
      (ticker symbol CETUS) is a transferable representation of attributed governance and 
      utility functions specified in the protocol/code of Cetus, and which is designed to be used 
      solely as an interoperable utility token thereon. Users can earn it through liquidity mining on Cetus.
<br />CETUS is a functional multi-utility token which will be used as the medium of 
exchange between participants on Cetus in a decentralized manner. The goal of introducing CETUS
 is to provide a convenient and secure mode of payment and settlement between participants who 
 interact within the ecosystem on Cetus without any intermediaries such as centralized third party 
 entity/institution/credit. It is not, and not intended to be, a medium of exchange accepted by the 
 public (or a section of the public) as payment for goods or services or for the discharge of a debt; nor 
 is it designed or intended to be used by any person as payment for any goods or services whatsoever that are not
  exclusively provided by the issuer. CETUS does not in any way represent any shareholding, ownership, participation, 
  right, title, or interest in the Company, the Distributor, their respective affiliates, or any other company, enterprise or undertaking, 
  nor will CETUS entitle token holders to any promise of fees, dividends, revenue, profits or investment returns, and are not intended to constitute 
  securities in the British Virgin Islands, Singapore or any relevant jurisdiction. CETUS may only 
  be utilized on Cetus, and ownership of the same carries no rights, express or implied, other than the 
  right to use CETUS as a means to enable usage of and interaction within Cetus. The secondary market pricing of CETUS is not dependent 
  on the effort of the Cetus Project Contributors, and there is no token functionality or scheme designed to control or manipulate such secondary pricing.
<br />Further, CETUS provides the economic incentives which will be distributed to encourage 
users to exert efforts towards contribution and participation in the ecosystem on Cetus, thereby 
creating a mutually beneficial system where every participant is fairly compensated for its efforts. 
CETUS is an integral and indispensable part of Cetus, because without CETUS, there would be no incentive 
for users to expend resources to participate in activities or provide services for the benefit of the 
entire ecosystem on Cetus. Given that additional CETUS will be awarded to a user based only on its actual
 usage, activity and efforts made on Cetus and/or proportionate to the frequency and volume of transactions, 
 users of Cetus and/or holders of CETUS which did not actively participate will not receive any CETUS incentives.
      </p>
